        //     )
        // }

        return (
            <div id="container">
                <div id="topSide">
                    <p>{`${data.about.name} ${data.about.surname}`}</p>
                    <div id="info">
                        <p>{data.about.email}</p>
                        <p>{data.about.address}</p>
                        <p>{data.about.phone}</p>
                    </div>
                </div>
                <div id="profile">
                    <p>{data.about.description}</p>
                </div>
                <div id="education">
                    {eduInstitutions}
                </div>
                <div id="experience">
                    {/* {workInstitutions} */}
                </div>
                <div id="extraInfo">
                    <div id="skills">
                        <p>{data.extraInfo.skills}</p>
                    </div>
                    <div id="languages">
                        <p>{data.extraInfo.languages}</p>
                    </div>
                </div>
            </div>
        );
    }
}

export default CV;
